const i=e=>({"@context":"https://schema.org","@type":"FAQPage",mainEntity:e.map(t=>({"@type":"Question",name:t.question,acceptedAnswer:{"@type":"Answer",text:t.answer}}))}),o=e=>({"@context":"https://schema.org","@graph":e.map(a=>{const{"@context":n,...s}=a;return s})}),r={leadCapture:[{question:"What types of lead capture forms does AgentBio offer?",answer:"AgentBio offers three specialized lead capture forms for real estate agents: Buyer Inquiry Forms with pre-qualification questions like budget and pre-approval status, Seller Lead Forms that capture timeline and motivation to sell, and Home Valuation Request Forms that attract seller leads with free property valuations."},{question:"How does AgentBio's lead scoring work?",answer:"AgentBio automatically scores leads as Hot, Warm, or Cold based on their responses. Hot leads are pre-approved buyers with 0-30 day timelines, Warm leads have 30-90 day timelines with defined budgets, and Cold leads are in early research with 90+ day timelines. This helps agents prioritize who to call first."},{question:"Do I get notified when someone submits a lead form?",answer:"Yes, AgentBio sends instant email notifications when leads submit forms. You receive all lead details including name, budget, timeline, and pre-approval status within seconds, allowing you to follow up while leads are still hot."},{question:"Can I export leads to my CRM?",answer:"Yes, all leads captured through AgentBio forms are stored in your dashboard and can be exported to your CRM anytime. You can sort leads by date, type, or status before exporting."}],analytics:[{question:"What analytics does AgentBio track?",answer:"AgentBio tracks comprehensive analytics including page views, unique visitors, link clicks, lead form submissions, and engagement time. You can see which listings get the most views and which content drives the most leads."},{question:"Can I see where my traffic comes from?",answer:"Yes, AgentBio analytics show traffic sources including direct visits, social media referrals, and search engine traffic. This helps you understand which marketing channels drive the most engagement."},{question:"How often are analytics updated?",answer:"AgentBio analytics update in real-time. You can see visitor activity as it happens and track daily, weekly, and monthly trends from your dashboard."}]};export{r as F,o as a,i as g};
